import React, { useEffect, useState } from "react";
import { Search } from "lucide-react";
import { Card, CardContent, CardHeader, CardTitle } from "@/components/ui/card";
import { Input } from "@/components/ui/input";
import { Table, TableBody, TableCell, TableHead, TableHeader, TableRow } from "@/components/ui/table";
import { Alert, AlertDescription } from "@/components/ui/alert";
import api from "../services/api";

const AtivoList = () => {
  const [ativos, setAtivos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    const fetchAtivos = async () => {
      try {
        setLoading(true);
        const response = await api.get("ativos/");
        setAtivos(response.data);
        setError(null);
      } catch (error) {
        setError("Não foi possível carregar os ativos. Por favor, tente novamente mais tarde.");
        console.error("Erro ao buscar ativos:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchAtivos();
  }, []);

  const filteredAtivos = ativos.filter((ativo) =>
    Object.values(ativo).some((value) =>
      value?.toString().toLowerCase().includes(searchTerm.toLowerCase())
    )
  );

  const formatDate = (dateString) => {
    if (!dateString) return "-";
    return new Date(dateString).toLocaleDateString("pt-BR");
  };

  if (loading) {
    return (
      <Card className="w-full">
        <CardContent className="p-6">
          <div className="flex items-center justify-center h-64">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary"></div>
          </div>
        </CardContent>
      </Card>
    );
  }

  if (error) {
    return (
      <Alert variant="destructive" className="mx-4">
        <AlertDescription>{error}</AlertDescription>
      </Alert>
    );
  }

  return (
    <Card className="w-full">
      <CardHeader>
        <CardTitle className="text-2xl font-bold">Lista de Ativos</CardTitle>
        <div className="relative">
          <Search className="absolute left-2 top-2.5 h-4 w-4 text-muted-foreground" />
          <Input
            placeholder="Pesquisar ativos..."
            className="pl-8"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>
      </CardHeader>
      <CardContent>
        <div className="rounded-md border">
          <Table>
            <TableHeader>
              <TableRow>
                <TableHead>Nome</TableHead>
                <TableHead>Patrimônio</TableHead>
                <TableHead>Categoria</TableHead>
                <TableHead>Responsável</TableHead>
                <TableHead>Última Avaliação</TableHead>
                <TableHead>Próxima Avaliação</TableHead>
              </TableRow>
            </TableHeader>
            <TableBody>
              {filteredAtivos.length === 0 ? (
                <TableRow>
                  <TableCell colSpan={6} className="text-center h-32">
                    Nenhum ativo encontrado
                  </TableCell>
                </TableRow>
              ) : (
                filteredAtivos.map((ativo) => (
                  <TableRow
                    key={ativo.id}
                    className="hover:bg-muted/50 cursor-pointer transition-colors"
                  >
                    <TableCell className="font-medium">{ativo.nome}</TableCell>
                    <TableCell>{ativo.codigo_patrimonio}</TableCell>
                    <TableCell>{ativo.categoria}</TableCell>
                    <TableCell>{ativo.responsavel}</TableCell>
                    <TableCell>{formatDate(ativo.data_ultima_avaliacao)}</TableCell>
                    <TableCell>{formatDate(ativo.data_proxima_avaliacao)}</TableCell>
                  </TableRow>
                ))
              )}
            </TableBody>
          </Table>
        </div>
      </CardContent>
    </Card>
  );
};

export default AtivoList;
